import { Row, Col } from "react-bootstrap";

function MyAccordin() {
  return (
    <>
      <Row>
        <Col className="justify-content-between align-items-center"></Col>

        <Col></Col>
        <Col></Col>
      </Row>
    </>
  );
}

export default MyAccordin;
